<script>
    var canvas = document.querySelector('svg');
    
	var back = document.querySelector('#back');
	back.parentNode.removeChild(back);
	
	var draw = document.querySelector('#draw');
	
	var nodes = draw.querySelectorAll('path,polygon,circle');
	
	for	(var i = 0; i<nodes.length ; i++){
		draw.removeChild(nodes[i]);
	}
	
	function decodeBase64Image(dataString) {
	  var matches = dataString.match(/^data:([A-Za-z-+\/]+);base64,(.+)$/),
		response = {};

	  if (matches.length !== 3) {
		return new Error('Invalid input string');
	  }

	  response.type = matches[1];
	  response.data = new Buffer(matches[2], 'base64');

	  return response;
	}

	var i=0;
	var fs = require('fs');
	var Camana = require('../caman.full');
	function next(){
		draw.appendChild(nodes[i]);
		saveSvgAsPng(canvas, {}, function(content,cn){
			console.log("cotnentt....");
			debugger;
			fs.writeFile('res/'+i+".png",decodeBase64Image(content).data,function(err){
				i++;
				console.log('writted');
				next();
			});
		});
		draw.removeChild(nodes[i]);
	
		
	}
	next();
	
	
	
	
    
</script>
